import React from 'react';

const Movie = () => {
  
  const { id, name, year, rating, image } = props;
  return (
    <div>
      <h1>{id}</h1>
      <h1>{name}</h1>
      <h1>{year}</h1>
      <h1>{rating}</h1>
      image: <img src={image} alt={name} />
    </div>
  );
};

export default Movie;
